     <SocialIcon url="https://twitter.com/lu_calm" bgColor="#000000" style={{ height: 40, width: 40 }}/> {'  '}
      <SocialIcon url="https://github.com/lu-calm" bgColor="#000000" style={{ height: 40, width: 40 }}/> {'  '}
